package V41;

import java.util.Scanner;

public class upgift {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner input = new Scanner(System.in);
		
		int X = input.nextInt();
		int Y = input.nextInt();
		
		if(Y <= X) {
			System.out.println(Y);
		}
		if(X <= Y) {
			System.out.println(X);
		}
			
			
		

	}

}
